import React, { useRef, useEffect, useCallback } from 'react';
import { screenToWorld, worldToScreen } from '../utils/coordinates';

const COLORS = {
  'Пошаговый алгоритм': '#FF6B6B',
  'Алгоритм ЦДА': '#4ECDC4',
  'Брезенхем (линия)': '#45B7D1',
  'Брезенхем (окружность)': '#96CEB4',
};

const Canvas = ({ 
  results = [], 
  currentPoints = [], 
  onPointSelect, 
  scale = 20,
  onScaleChange 
}) => {
  const canvasRef = useRef(null);
  const sizeRef = useRef({ width: 0, height: 0 });

  const draw = useCallback((ctx, width, height) => {
    ctx.fillStyle = '#ffffff';
    ctx.fillRect(0, 0, width, height);
    ctx.save();
    ctx.translate(width / 2, height / 2);
    ctx.scale(scale, -scale);
    ctx.lineWidth = 1 / scale;
    ctx.strokeStyle = '#e0e0e0';
    ctx.fillStyle = '#000';

    // Сетка (шаг 1 единица)
    const viewSize = Math.max(width, height) / scale * 0.6;
    const gridMin = -Math.ceil(viewSize);
    const gridMax = Math.ceil(viewSize);
    for (let i = gridMin; i <= gridMax; i++) {
      // Вертикальные линии
      ctx.beginPath();
      ctx.moveTo(i, gridMin);
      ctx.lineTo(i, gridMax);
      ctx.stroke();
      // Горизонтальные
      ctx.beginPath();
      ctx.moveTo(gridMin, i);
      ctx.lineTo(gridMax, i);
      ctx.stroke();
    }

    // Оси
    ctx.strokeStyle = '#666';
    ctx.lineWidth = 2 / scale;
    ctx.beginPath();
    ctx.moveTo(-1000, 0);
    ctx.lineTo(1000, 0);
    ctx.stroke();
    ctx.beginPath();
    ctx.moveTo(0, -1000);
    ctx.lineTo(0, 1000);
    ctx.stroke();

    // Подписи осей
    ctx.fillStyle = '#000';
    ctx.textAlign = 'center';
    ctx.textBaseline = 'middle';
    for (let i = gridMin; i <= gridMax; i += 5) {
      ctx.save();
      ctx.translate(i, 0);
      ctx.rotate(-Math.PI / 2);
      ctx.fillText(i.toString(), 0, -15 / scale);
      ctx.restore();
      ctx.fillText(i.toString(), i, 15 / scale);
    }

    ctx.restore();

    // Текущие точки выбора (большие)
    ctx.fillStyle = '#FFD700';
    ctx.strokeStyle = '#000';
    ctx.lineWidth = 2;
    currentPoints.forEach(([x, y]) => {
      const [sx, sy] = worldToScreen(x, y, width, height, scale);
      ctx.beginPath();
      ctx.arc(sx, sy, 8, 0, 2 * Math.PI);
      ctx.fill();
      ctx.stroke();
    });

    // Точки алгоритмов (квадраты пикселей)
    results.forEach(({ points, name }) => {
      const color = COLORS[name] || '#888';
      ctx.fillStyle = color;
      points.forEach(([wx, wy]) => {
        const [sx, sy] = worldToScreen(wx, wy, width, height, scale);
        const pixelSize = scale * 0.8;
        ctx.fillRect(sx - pixelSize/2, sy - pixelSize/2, pixelSize, pixelSize);
      });
    });
  }, [results, currentPoints, scale]);

  const resize = useCallback(() => {
    const canvas = canvasRef.current;
    if (!canvas) return;
    const rect = canvas.getBoundingClientRect();
    canvas.width = rect.width * window.devicePixelRatio;
    canvas.height = rect.height * window.devicePixelRatio;
    sizeRef.current = { width: canvas.width, height: canvas.height };
    const ctx = canvas.getContext('2d');
    ctx.scale(window.devicePixelRatio, window.devicePixelRatio);
    draw(ctx, rect.width, rect.height);
  }, [draw]);

  useEffect(() => {
    window.addEventListener('resize', resize);
    resize();
    return () => window.removeEventListener('resize', resize);
  }, [resize]);

  useEffect(() => {
    const canvas = canvasRef.current;
    if (!canvas) return;
    const ctx = canvas.getContext('2d');
    const rect = canvas.getBoundingClientRect();
    draw(ctx, rect.width, rect.height);
  }, [draw]);

  const handleWheel = useCallback((e) => {
    e.preventDefault();
    const delta = e.deltaY > 0 ? 0.9 : 1.1;
    const newScale = scale * delta;
    onScaleChange(newScale);
  }, [scale, onScaleChange]);

  const handleClick = useCallback((e) => {
    const canvas = canvasRef.current;
    if (!canvas || !onPointSelect) return;
    const rect = canvas.getBoundingClientRect();
    const x = e.clientX - rect.left;
    const y = e.clientY - rect.top;
    const width = rect.width;
    const height = rect.height;
    const [wx, wy] = screenToWorld(x, y, width, height, scale);
    onPointSelect(Math.round(wx), Math.round(wy));
  }, [onPointSelect, scale]);

  return (
    <canvas
      ref={canvasRef}
      className="canvas"
      onWheel={handleWheel}
      onClick={handleClick}
      style={{ cursor: 'crosshair' }}
    />
  );
};

export default Canvas;
